import React from "react";
import { useState, useEffect } from "react/cjs/react.development";

export default function UserStatus() {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    const getUsers = async () => {
      const res = await fetch("https://test.clitehd.com/api/login");
      const getdata = await res.json();
      setUsers(getdata);
    };
    getUsers();
  }, []);

  const handleDelete = async () => {
    console.log(roomname);
    const reqDelete = await fetch(
      `https://test.clitehd.com/api/meetinghistory/${roomname}`
    );
    const resDelete = await reqDelete.json();
    setMessage(resDelete.message);
  };

  return (
    <div>
      <table class="styled-table">
        <thead>
          <tr>
            <th>#</th>
            <th>Users</th>
            <th>Action</th>
            {localStorage.getItem("admin") === "true"
              ? console.log("admin")
              : console.log("")}
          </tr>
        </thead>
        <tbody>
          {users.map((getusers, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{getusers.email}</td>
              <td>
                <button
                  className="btn btn-danger"
                  onClick={() => handleDelete(getusers.email)}
                >
                  Delete
                </button>
              </td>
              {localStorage.getItem("admin") === "true"
                ? console.log("admin")
                : console.log("")}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
